1:"CEucdPiF-Ho";}i:249;a:1:{s:12:"created_time";i:1599246311;}i:250;a:1:{s:7:"caption";s:1213:"Rainwater harvesting!
⛰️
I had just climbed down (more like slipped down) a steep, wet, clay-ey mountain and I found this secret pond.
💦
The thought of wild snakes slithering amidst the pond's rocky bed, and the possibility of inquisitive humans arriving at this oasis did cross my mind but the sound of the lapping waves instigated my eager spirit. I shed my inhibitions and jumped right in. 
🌊
I spent my time floating and splashing about in the water, admiring the mountain in the background, thinking about how much I had missed swimming and that this moment was so precious. However, all's not fun in this story... While getting out, I stepped on some sharp underwater rocks and got a smarting cut on my foot. I had to limp a few kilometers to reach the car and eventually made it home safely. Now that I'm well, I can bravely claim: there's no better swimsuit than my birthday suit 😛.
